from copy import deepcopy


class Bear:
    def __init__(self,DNA_string):
        self.dna_string = DNA_string

        self.excess_chars = self.get_excess_char_count()
        self.min_length = self.get_minimum_substring_to_replace()


    def get_excess_char_count(self):
        expected_count = len(self.dna_string) / 4

        excess_G = self.dna_string.count('G') - expected_count
        excess_C = self.dna_string.count('C') - expected_count
        excess_A = self.dna_string.count('A') - expected_count
        excess_T = self.dna_string.count('T') - expected_count

        excess_chars = {}

        self.append_excess_chars(excess_G, 'G', excess_chars)
        self.append_excess_chars(excess_C, 'C', excess_chars)
        self.append_excess_chars(excess_A, 'A', excess_chars)
        self.append_excess_chars(excess_T, 'T', excess_chars)

        return excess_chars

        self.length = len(excess_chars)


    def append_excess_chars(self,excess, char, excess_list):
        excess_list[char] = excess


    def substring_contains_all_excess_chars(self,substring, excess_chars):
        #print(excess_chars)
        if (excess_chars['G'] > substring.count('G')):
            return False
        if (excess_chars['C'] > substring.count('C')):
            return False
        if (excess_chars['T'] > substring.count('T')):
            return False
        if (excess_chars['A'] > substring.count('A')):
            return False
        # excess_chars_copy = deepcopy(excess_chars)
        # for letter in substring:
        #     if letter in excess_chars_copy.keys():
        #         excess_chars_copy[letter] = excess_chars_copy[letter] - 1
        # for letter in excess_chars_copy.keys():
        #     if excess_chars_copy[letter] > 0:
        #         return False
        return True


    def get_minimum_substring_to_replace(self):
        start_index, end_index = 0, 0
        min_substring_length = len(self.dna_string)
        count = {'G':0,'C':0,'A':0,'T':0}

        while start_index <= end_index:
            substring = self.dna_string[start_index:end_index]
            #if (self.substring_contains_all_excess_chars(substring, self.excess_chars)):
            if (count['G'] >= self.excess_chars['G'] and count['C'] >= self.excess_chars['C'] and count['A'] >= self.excess_chars['A'] and count['T'] >= self.excess_chars['T']):
                count[self.dna_string[start_index]] -= 1
                start_index += 1
                #min_substring_length = len(substring)
                if (len(substring) < min_substring_length):
                    min_substring_length = len(substring)
            else:
                end_index += 1
                if end_index == len(self.dna_string):
                    break
                count[self.dna_string[end_index-1]] += 1
        return min_substring_length




    def is_steady(self,dna_string):
        G_num = dna_string.count('G')
        C_num = dna_string.count('C')
        A_num = dna_string.count('A')
        G_num = dna_string.count('T')
        return (G_num == C_num and C_num == A_num and A_num == G_num)


